import {Layout, Menu} from "antd";

const Navbar = () => {
    return (
        <Layout.Header>
            <Menu node = "horizontal"
            defaultSelectedKeys={['I1']}
            >

                <Menu.Item 
                key="I1"
                value="I1" 
                onCick={(v) => console.log("Item 1", v)}
                >
                </Menu.Item>
                <Menu.Item 
                key="I2"
                value="I2" 
                onCick={(v) => console.log("Item 2", v)}
                >
                </Menu.Item>
            </Menu>
        </Layout.Header>
    )
}
export default Navbar
